ダストマン生ゴミ用消臭シート 1枚入<br>ブランド：キチントさん<br>販売・製造元：クレハ<br><br>生ゴミのにおいを脱臭・消臭する消臭シートです。<br>イヤなニオイを活性炭と活性炭素繊維がすばやく吸着し、人工酵素が化学分解して消臭します。<br>うすくて場所をとらず、ゴミ箱の裏に貼れます。<br>効果は約2ヶ月持続します。<br> <br><br><br>使用方法<br>(1)本体(不織布)を外装から取り出してください。<br>(2)開封から2か月後のお取り替え時期(目安)を記入してください。<br>(3)本体(不織布)の裏面についているテープのはくり紙をはがしてください。<br>(4)ゴミ容器のフタの裏等に貼り付けてご使用ください。<br>※貼る前に、貼る箇所のフタの汚れ・水分をよくふき取ってください。<br> <br><br>使用上の注意<br>●本品は食べられません。<br>●使用期間は開封後2か月です。<br>※環境によって異なりますので、効力が弱まったらお取替えください。<br>●本品は紙製品です。<br>ご使用後は、各自治体の区分に従って廃棄してください。<br> 品質表示材質：パルプ有効成分：活性炭、活性炭素繊維、人工酵素<br> 原産国日本 <br><br>お問い合わせ先<br>株式会社クレハお客様相談室 03-3249-4700受付時間 9：00-12：00/12：45-17：30(土曜、日曜、祝日を除く) 消臭剤全部とは消臭剤は、お部屋やトイレ、車の中など、あらゆる空間の嫌なニオイを消す商品です。<br>屋外用、業務用の消臭剤から、赤ちゃんがいても使える自然派の消臭剤まで豊富なラインナップ。<br>消臭スプレー、消臭シール・消臭ボトル等、用途に合った消臭剤をお選び下さい。<br><br>日用品／家庭用品／消臭・芳香剤／脱臭剤<br>JANコード： 4901422496128<br><br>CS：160<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
