巻きポカ 足首用ホルダー2個 シート4枚入<br>ブランド：巻きポカ<br>販売・製造元：桐灰化学<br><br>巻くだけ簡単で、足首から温かさが拡がる温熱パットです。<br>専用温熱シートは片面にフィルムを使用しているので、肌に効率よく熱を伝えます。<br> <br><br><br>使用方法<br>巻きポカ専用として温度調整された専用温熱シートです。<br>必ず「巻きポカ」専用ホルダーのポケットに入れてご使用ください。<br>1.使用直前に外袋から専用温熱シートを取出し、印刷面を肌側にして、もまずに補助ホルダーのポケットに入れてご使用ください。<br>2.足首内側のくるぶしより上部に専用温熱シートがあたるように巻いてください。<br>*締めすぎないように注意してください。<br>*靴下の上から巻いてください。<br>*専用温熱シートは必ず専用ホルダーのポッケットの中に入れてご使用ください。<br>*専用温熱シート以外の使い捨てカイロは、十分発熱しない場合がありますので使用しないでください。<br>*専用温熱シートを使い切ったら、必ず「巻きポカ」取替え用をお買い求めのうえ、ご使用ください。<br> 専用ホルダーに関する注意・長時間水に濡れたまま放置すると、色落ちする恐れがありますのでご注意ください。<br>・色移りの恐れがありますので、色柄ものと一緒に洗濯しないでください。<br>・専用ホルダーを洗濯するときは、面ファスナー部が、他の繊維に掛着する場合があります。<br>洗濯機利用の際はネットに入れるか、手洗いで中性洗剤を用いてください。<br>・タンプル乾燥(乾燥機)の使用は避けてください。<br>・アイロン、ドライクリーニングはお避けください。<br> <br><br>使用上の注意<br>●締めすぎないようにご注意ください。<br>きつく締めすぎるとうっ血を起こす恐れがあります。<br>●次の方は使用しないで下さい。<br>・打撲、捻挫等で患部に熱がある方・自ら意思ですぐに取り外す事が出来ない方・手や足に血行障害がある方●低温やけどは、体温より高い温度の発熱体を長時間当てていると紅斑、水泡等の症状を起こすやけどのことです。<br>なお、自覚症状をともなわないで低温やけどになる場合がありますのでご注意ください。<br>・「巻きポカ」以外の使い捨てカイロを専用ホルダーに入れてのご使用はお避けください。<br>・他のカイロでは十分な発熱が得られない場合や、発熱しすぎる場合があります。<br> 低温やけど防止のための注意・肌に直接あてず、必ず専用ホルダーのポケットの中に入れて使用ください。<br>・就寝時やふとんの中でのご使用はお避けください。<br>・専用温熱シートを使用した状態でさらに上から押さえつけたり、長時間圧迫しないでください。<br>血行が悪くなり、低温やけどの原因になります。<br>・1時間に1回程度、肌の状態を確認してください。<br>異常が認められる場合は、すぐに取り除いてください。<br>・皮膚の弱い方は低温やけどにご注意ください。<br>・熱すぎると感じたときはすぐに使用を中止してください。<br>・コタツや電気カーペットその他暖房器具と併用はお避けください。<br>・激しい運動時の使用はお避けください。<br>・肌に赤み、かゆみ、痛みなどのやけどの症状がでたときはすぐに中止し、医師にご相談ください。<br> 保存方法・直射日光をさけ、涼しい所に保管してください。<br>・幼児の手の届く所に置かないでください。<br> その他の注意(専用温熱シート)・用途以外に使用しないでください。<br>・食べられません。<br>口に入れないでください。<br>間違って飲み込んだ場合は、うがいをし医師の診断を受けてください。<br>・万一目に入った場合は、こすらずに流水で15分以上洗い流し、医師の診断を受けてください。<br>・捨てるときは、市区町村で定める区分に従ってください。<br>・有効期限内にご使用ください。<br>・専用温熱シートの発熱が終了したらすぐに取り除いてください。<br> 材質表地：ポリエステル芯部：ポリエステル裏地：綿35%、ポリエステル65%<br> 原産国温熱シート：日本ホルダー：中国 <br>衛生医療／温熱用具／温熱パット／温熱パット足用<br>JANコード： 4901548252066<br><br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
