バンドエイド タコウオノメ除去 足の指用 6枚<br>ブランド：バンドエイド(BAND-AID)<br>販売・製造元：ジョンソン・エンド・ジョンソン<br><br>タコ・ウオノメを靴の圧迫や摩擦などの痛みから保護します。<br>サリチル酸配合ディスクが、かたく厚くなった皮膚をやわらかくし、タコ・ウオノメを簡単に取り除きます。<br>そして、保水性のある保護用パッドが水分を吸収・保持した状態にお肌を整え、サリチル酸のはたらきをより発揮しやすくします。<br>汗や水に強い防水タイプで、つけたまま入浴できます。<br>足の指用、医薬部外品です。<br>サリチル酸ディスク・保護用パッド各6枚入り。<br> <br>効能・効果タコ、ウオノメ <br><br>使用上の注意<br>●乳幼児には使用しないこと。<br>●いぼ、目の周囲、粘膜、顔面、やわらかい皮膚面(首の周りなど)、炎症又は傷のある部位には使用しないこと。<br>●本人又は家族がアレルギー症状を起こしたことがある人は使用につき医師又は薬剤師に相談すること。<br>●直射日光を避け、なるべく涼しい所に保管すること。<br>●使用に際しては、使用文書をよく読むこと。<br> 有効成分サリチル酸(配合量40%) 添加剤貼付クッション、その他2成分 <br>衛生医療／絆創膏／足／靴ずれ・うおのめ用絆創膏<br>JANコード： 4901730075930<br><br>CS：72<br>区分：指定医薬部外品<br>原産国：デンマーク<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
