カビキラー ゴムパッキン用 100g<br>ブランド：カビキラー<br>販売・製造元：ジョンソン<br><br>ジェルが密着して、ゴムパッキンのカビを効果的に落とす、おふろ用防カビ・カビとり剤です。<br>塗った後は、水拭きするか、水で洗い流すだけの、簡単な使い方。<br>タイル目地や、湿気のある場所の繋ぎ目、結露を起こす窓枠、冷蔵庫のゴムパッキンなどにもお使いいただけます。<br>細かいところも塗りやすいペンタイプ。<br> <br>成分次亜塩素酸塩、水酸化ナトリウム(1.0%)、界面活性剤(アルキルアミンオキシド)、安定剤 液性アルカリ性 用途・ゴムパッキン、コーキング等のカビ汚れ・浴室の扉、タイルの目地、窓枠・洗面所、キッチンシンクまわりのつなぎめ・結露をおこす部屋の窓枠・冷蔵庫のゴムパッキン●使えないもの・砂壁、繊維壁、漆喰、布張りの壁、ユニットバスの化粧鋼板壁(磁石がつくタイプ)・ホーロー、アルミ、しんちゅう等の金属製品(サビの原因になる)・木製品・獣毛のハケ、ブラシ・人造大理石・衣類 <br><br>使用方法<br>使用量の目安：1mあたり3-5g1.汚れやほこりがたまっている場合は、あらかじめ乾拭きしたり、中性洗剤等で取り除く。<br>2.キャップを取り、汚れの部分に直接塗る。<br>ボトルを軽く押しながら、液の出る量を加減する。<br>強く押しすぎると液が飛び出すおそれがあるので注意。<br>3.そのまま10-30分放置する。<br>4.カビ汚れがおちたら、充分に水ぶきするか、水で洗い流す。<br>ウェットティッシュは使わない。<br>5.塗布後カビがとれない場合には再度繰り返す。<br>6.使用後はキャップをきちんとしめ、冷暗所に保管する。<br>作業後は必ず手を洗い、その後、顔、目も洗う。<br> <br><br>使用上の注意<br>●液が目に入らないように注意。<br>●必ず単独で使用。<br>酸性タイプの製品や食酸、アルコール、アンモニア等と混ざると有害なガスが発生して危険。<br>●目線より上には使用しない。<br>●用途以外に使わない。<br>●外国製のタイルやユニットバスは変色することがあるので、必ず目立たないところで試してから使う。<br>●浴槽、壁、サッシ液が付着すると変色することがあるので、放置せずすぐに水で洗い流す。<br>●衣類や敷物につくと脱色するので注意。<br>●破損をさけるため、落とさない。<br> 応急処置●目に入ったときすぐ流水で15分以上洗い流す。<br>必ず眼科医に相談する。<br>そのまま放置すると失明のおそれがある。<br>●飲み込んだとき吐かせず、すぐ口をすすぎ、コップ1-2杯の水か牛乳を飲ませ、医師に相談する。<br>●皮ふについたときすぐにぬめり感がなくなるまで流水で洗い流す。<br>異常がある場合は、皮膚科医に相談する。<br>●使用中、目にしみたり、気分が悪くなった時は、使用をやめてその場を離れ、洗眼、うがい等をする。<br>*いづれの場合も、受診時は商品を持参する。<br> <br>日用品／掃除用品／お風呂用 掃除用品／防カビ・カビとり<br>JANコード： 4901609000339<br><br>CS：32<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
